import React from 'react'

const Video = () => {

    const main_div = {
        position : "relative",
        height: '100vh',
        width : '100vw',
        backgroundImage: "linear-gradient(to right, #000000, #3533cd 60%)", 
        backgroundSize: '200vw 200vh',
        backgroundAttachment: 'fixed',
    };

    const video_div = {
        position : "relative",
        borderRadius: '10px',
        textAlign: 'center',
        boxShadow: '0 4px 8px rgba(0, 0, 0, 0.3)',
        height : "50vh",
        width: '35vw',
        color: "white",
        border : "5px dotted white",
        borderRadius : "60px",
        top : "25vh",
        width : "25vw",
    };

  return (
    <div style = {main_div}>
      <div style = {video_div}>

      </div>
    </div>
  )
}

export default Video
